import React from 'react';
import useForm from './customHooks';
import {MenuItem,Select,Radio,FormControl,FormLabel,RadioGroup,Grid,Accordion,Typography,Paper,Box,Link,Checkbox,TextField,Button,FormControlLabel,AccordionSummary,Slider, Divider} from '@material-ui/core';

export default function  Form () {
    const {inputs, handleInputChange, handleSubmit} = useForm({
      paciente:{
        "edad":""
      },
      antecedentes:false,
      factoresRiesgos:false,
      clinica:false,
      datosAngio:false,
      lesiones:false,
      procedimiento:false,
      complicacionesSala:false
      });
    return (
      <form onSubmit={handleSubmit}>
	      <div>
	        <label>Email Address</label>
	        <input type="email" name="email" onChange={handleInputChange} value={inputs.paciente.edad} required />
	      </div>

	      <div>
	        <label>Password</label>
	        <input type="password" name="password" onChange={handleInputChange} value={inputs.password} required/>
	      </div>

	      <button type="submit">Submit</button>
	    </form>
    )
}
